import { Container } from 'react-bootstrap';
import { Switch, Route } from 'react-router-dom';

import './App.scss';
import Nav from './Nav';
import UsersNew from "./User/New"

function App() {
  return (
      <Container fluid>
        <Nav />
        <Switch>
          <Route path="/" exact>
            <h2>Wellness</h2>
          </Route>
          <Route path="/lostfound">
            <h2>Lost/Found Cat</h2>
          </Route>
          <Route path="/food">
            <h2>Food Choices</h2>
          </Route>
          <Route path="/selladopt">
            <h2>Sell/Adopt Cat</h2>
          </Route>
          <Route path="/forum">
            <h2>Kitten Lover Forum</h2>
          </Route>
          <Route path="/users/new">
            <UsersNew />
          </Route>
        </Switch>
      </Container>
  );
}

export default App;
